@feriacubecz @FabioPorchat Foi  o que matou a menina ?
Olha a guerra que se quer justificar. 
Ele escolheu a profissão.

@SiSalvate @UJPV1 No me llama la atención que un soldado mate a un civil si es lo que preguntas. Que me parezca una injusticia es otra cosa.
Verás si yo te digo que si pasas de ahí te pego un tiro y tu pasas, yo soy una asesina, pero tu eres un suicida
¿Entiendes ahora lo que me llama la atención?

@LeonelRadde Sabe o que é triste? O sangue do policial que morre, o sangue do policial que se suicida por estresse, o sangue da Agatha, o sangue do moleque aviãozinho que morre no morro, o sangue dos inocentes.
Pra eles tem todo o mesmo peso.
São sangue que traz voto!
